package com.capitalone.revature.week1.q11b;

public class FloatNumbers {
	float f1;
	float f2;

	public FloatNumbers() {
		super();
		// TODO Auto-generated constructor stub
	}

	public FloatNumbers(float f1, float f2) {
		super();
		this.f1 = f1;
		this.f2 = f2;
	}

	public float getF1() {
		return f1;
	}

	public void setF1(float f1) {
		this.f1 = f1;
	}

	public float getF2() {
		return f2;
	}

	public void setF2(float f2) {
		this.f2 = f2;
	}

}
